import React from 'react';
import '../utils/style/Convictions.css';
import Banner4 from './Banners/Banner4';

function ContactUs (){
	return (
		<div id="contact">
			<Banner4 />
			<div>
				<h2 className='contact__title'>Rejoignez-nous !</h2>
			</div>
			<div className='contact__container' id="collectif">


				<div className='contact__text'>

					<a href="mailto:contact@telemaque.eu"> Ecrivez </a>


				</div>
			</div>
		</div>
	)
}

export default ContactUs
